const uint32_t* emoji_lookup(uint32_t codepoint) {
    for (size_t i = 0; i < EMOJI_COUNT; i++) {
        if (emoji_table[i].codepoint == codepoint) {
            return emoji_table[i].data;
        }
    }
    return NULL;
}

int emoji_is_emoji(uint32_t codepoint) {
    /* Miscellaneous Symbols */
    if (codepoint >= 0x2600 && codepoint <= 0x26FF) return 1;
    /* Dingbats */
    if (codepoint >= 0x2700 && codepoint <= 0x27BF) return 1;
    /* Emoticons and beyond */
    if (codepoint >= 0x1F300 && codepoint <= 0x1FFFF) return 1;
    return 0;
}

